    data: |
      SELECT DISTINCT + 86 + col2 AS col1, - col2 FROM tab1 (FORMAT parquet) WHERE - ( - 54 ) NOT IN ( 93 * + - col2 + + 57 - ( + 99 ) );
  - name: tab1

outputs:
  - name: q9820.out
    data: |
      145	-59
      154	-68
      182	-96
